"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[359],{9:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"improve-async-code-with-event-loop","metadata":{"permalink":"/trouble-shootings/improve-async-code-with-event-loop","source":"@site/trouble-shootings/2025-06-01/Improve-async-code-with-event-loop.md","title":"Docker \ub85c\uadf8\uc778 \uc9c4\ud589 \ud6c4, auth \uc815\ubcf4\uac00 \uc81c\ub300\ub85c \ubc18\uc601\ub418\uc9c0 \uc54a\ub294 \ubb38\uc81c","description":"\ubb38\uc81c\uc0c1\ud669","date":"2025-06-01T00:00:00.000Z","tags":[{"inline":true,"label":"docker","permalink":"/trouble-shootings/tags/docker"},{"inline":true,"label":"linux","permalink":"/trouble-shootings/tags/linux"}],"readingTime":0.65,"hasTruncateMarker":true,"authors":[{"name":"Yongjoon Lee","title":"Backend Engineer @ M2cloud","url":"https://github.com/binsklee","email":"juckmyeol0716@gmail.com","page":{"permalink":"/trouble-shootings/authors/binsk"},"socials":{"github":"https://github.com/binsklee","linkedin":"https://www.linkedin.com/in/yongjoon-lee-binsk/"},"imageURL":"https://github.com/binsklee.png","key":"binsk"}],"frontMatter":{"slug":"improve-async-code-with-event-loop","title":"Docker \ub85c\uadf8\uc778 \uc9c4\ud589 \ud6c4, auth \uc815\ubcf4\uac00 \uc81c\ub300\ub85c \ubc18\uc601\ub418\uc9c0 \uc54a\ub294 \ubb38\uc81c","authors":["binsk"],"tags":["docker","linux"]},"unlisted":false},"content":"## \ubb38\uc81c\uc0c1\ud669\\n\\n`docker login` \uba85\ub839\uc5b4\ub97c \ud1b5\ud574 \uc778\uc99d \ud6c4, [ghcr.io](http://ghcr.io) \uc5d0 \ucee8\ud14c\uc774\ub108 \uc774\ubbf8\uc9c0\ub97c push \ud558\ub824\uace0 \ud588\ub354\ub2c8 \uc778\uc99d \uc2e4\ud328\uac00 \ubc1c\uc0dd\ud588\ub2e4.\\n\x3c!-- truncate --\x3e\\n`cat ~/.docker/config.json` \ub97c \ud1b5\ud574 \ud655\uc778\ud574\ubcf8 \uacb0\uacfc \uc544\ub798\uc640 \uac19\uc774 auth \ud56d\ubaa9\uc5d0 credential \uc815\ubcf4\uac00 \uc81c\ub300\ub85c \uae30\uc785\ub418\uc9c0 \uc54a\ub294 \uc0c1\ud669\uc774 \ubcf4\uc600\ub2e4.\\n\\n```json\\n\u276f cat ~/.docker/config.json\\n{\\n    \\"auths\\": {\\n        \\"ghcr.io\\": {}\\n    },\\n    \\"credsStore\\": \\"pass\\"\\n}\\n```\\n\\n\uc6d0\ub798 \ub85c\uadf8\uc778 \uc774\ud6c4 \\"ghcr.io\\" \ubd80\ubd84\uc5d0 \uc62c\ubc14\ub978 \uac12\uc774 \ub4e4\uc5b4\uac00\ub294 \uac83\uc73c\ub85c \uc54c\uace0 \uc788\uc9c0\ub9cc \ud658\uacbd\uc124\uc815\uc5d0 \ubb38\uc81c\uac00 \uc788\ub294\uc9c0 \ube48 \uac12\uc73c\ub85c \uc5c5\ub370\uc774\ud2b8 \ub41c \uc0c1\ud0dc\uc600\ub2e4.\\n\\n## \ud574\uacb0\ubc29\ubc95\\n\\n\uc774 \uacbd\uc6b0 linux\uc5d0\uc11c \uc0ac\uc6a9\uc911\uc778 `pass` \uc640 \uad00\ub828\ub41c \ubb38\uc81c\ub85c \ubcf4\uc5ec \uc0ac\uc2e4 pass\uc640 \uad00\ub828\ub41c \ubb38\uc81c\ub97c \ud574\uacb0\ud574\uc57c \ud558\uc9c0\ub9cc \ubb38\uc81c \ud574\uacb0\uc774 \uc2dc\uae09\ud55c \uacbd\uc6b0, \uc544\ub798\uc640 \uac19\uc774 auth\uc5d0 \uba85\uc2dc\uc801\uc73c\ub85c \uac12\uc744 \ub123\uc5b4 \ud574\uacb0\ud560 \uc218 \uc788\ub2e4.\\n\\n```json\\n{\\n  \\"auths\\": {\\n    \\"ghcr.io\\": {\\n      \\"auth\\": \\"dXNlcjoxMjM0\\"\\n    }\\n  },\\n  \\"credsStore\\": \\"pass\\"\\n}\\n```\\n\\n\uc704\uc758 \uacbd\uc6b0 `auth` \ub294 `<\uc720\uc800\uba85>:<credential>` \uc744 base64\ub85c \uc778\ucf54\ub529\ud55c \uac12\uc774\ub2e4.\\n\\n## \ub808\ud37c\ub7f0\uc2a4\\n- https://docs.docker.com/reference/cli/docker/login/\\n- https://stackoverflow.com/questions/43441454/docker-login-auth-token"}]}}')}}]);